import React from "react";
import './Helper.css';
import { Col, Container, Row } from "react-bootstrap";


function Helper(){
    return(
        <Container>
            <Row>
                <Col lg = "6" md = "6" sm = "12"> 
                <img src = "https://static.nike.com/a/images/t_PDP_1728_v1/f_auto,q_auto:eco/758c805c-dde5-4df5-9780-56196bcc238a/air-jordan-1-retro-high-og-womens-shoes-LcJVSj.png" />
                </Col>
                
                <Col lg = "6" md = "6" sm = "12">
                    <h1>Air Jordan 1 Retro High OG</h1>
                    <h4 class = "text-muted">Women's Shoes</h4>
                </Col>
            </Row>
        </Container>
    )
}

export default Helper
